// helper functions
void print(int *arr, int size){
    for(int i = 0; i < size-1; i++){
      cout << arr[i] << ',';
    }
    cout << arr[size - 1] << endl;
}
void swap(int a,int b, int *arr){
    int temp = arr[a];
    arr[a] = arr[b];
    arr[b] = temp;
}

//shellsort
void shellsort(int *arr, int size){
    //
    for (int split = size/2; split > 0; split = split / 2){
        for (int i = split; i < size; i++){
            int tmp = arr[i];
            int j;
            for (j = i; j >= split && arr[j - split] > tmp; j = j - split){
                arr[j] = arr[j - split];
            }
            arr[j] = tmp;
        }

    }

}
//straight insertion sort
void insertsort(int * arr, int size){
    int i = 1;
    while(i < size){
        int x = arr[i]; // get element to insert
        int j = i - 1; // start comparing with the next lower element
        while( j >= 0 && arr[j] > x){
            arr[j + 1] = arr[j];
            j = j - 1;
        }
        arr[j + 1] = x;
        i = i + 1;
    }
}
